import './Profile.css';
import './style.css';

// import { Link } from "react-router-dom";

export default function ProjectEntry(props) {


    let link = `/${props.name}`

    // <Link to={link}>
    //         <div className = "section-entry" key={props.id}>
    //             <img class = "entry-image" src={props.src}/>
    //             <div class = "entry-title">{props.name}</div>
    //             <div class = "entry-desc">{props.desc}</div>
    //         </div>
    //     </Link>

  
    return (
       
            <div className = "section-entry" key={props.id}>
                <img class = "entry-image" src={props.src}/>
                <div class = "entry-title">{props.name}</div>
                <div class = "entry-desc">{props.desc}</div>
            </div>
        
    );
      
  };
